// src/components/CaseManagement.js
import React from 'react';

const CaseManagement = () => {
    return (
        <div className="service-section">
            <h2>Case Management</h2>
            <div className="feature">
                <h3>File Organization</h3>
                <p>Organize and manage case files efficiently with our intuitive file management system.</p>
            </div>
            <div className="feature">
                <h3>Task Assignments</h3>
                <p>Assign tasks to team members and track progress to ensure cases are handled effectively.</p>
            </div>
            <div className="feature">
                <h3>Document Templates</h3>
                <p>Access a library of legal document templates to streamline document creation and processing.</p>
            </div>
        </div>
    );
};

export default CaseManagement;
